import React, {useState} from "react";
import './App.css';

let deposData = []
let withdrawData = []
fetch('https://steamdepos.ru/api/depos.json').then((res) => res.json()).then((data) => {deposData=data.data})
fetch('https://steamdepos.ru/api/withdraw.json').then((res) => res.json()).then((data) => {withdrawData=data.data})

const Header = ({setSort, setMin, setMax}) => {
  return (
    <div>
    <header>
      <img alt='beb' src="data:image/png;base64," />
      <fieldset className='sort'>
        <legend>Sort by</legend>
      <div className='sort_option'>
        <input type="radio" id="du" name="sort" value="du" defaultChecked onClick={() => {setSort(true)}} />
        <label htmlFor="du" >Deposit profit</label>
      </div>
      <div className='sort_option'>
        <input type="radio" id="wu" name="sort" value="wu" onClick={() => {setSort(false)}} /> 
        <label htmlFor="wu" >Withdrawal profit</label>
      </div>
      </fieldset>

      <fieldset className='filter'>
        <legend>Price</legend>
        <input type='number' id='min_price' placeholder='min' onChange={event => setMin(event.target.value)} />
        <input type='number' id='max_price' placeholder='max' onChange={event => setMax(event.target.value)}/>
      </fieldset>
    </header>
    </div>
  )
}



const Body = ({sortBy, minPrice, maxPrice, setMax}) => {
  if (maxPrice==0){
    setMax(10000)
  }
  function createSkin (skin, sort, buy, sell, buy_link, sell_link) {
    let id = skin['id']
    let name = skin['name']
    let buy_ref = skin[buy_link]
    let sell_ref = skin[sell_link]
    let price = skin[buy]
    let autobuy = skin[sell]
    let profit = skin[sort]
    return(
      <li className="skin" key={id}>
        <p className="skin_name">{name}</p>
        <p className="skin_profit">x{profit}</p>
        <div className="buysell">
          <a>Buy</a>
          <a>Sell</a>
        </div>
        <p></p>
        <div className="prices">
          <a href={buy_ref} target='_blank'>{price}₽</a>

          <a href={sell_ref} target='_blank'>{autobuy}₽</a>
        </div>
      </li>
    )
  }

  function sort (sort) {
    if (sort) {
      return deposData.map((skin) => 
        {if (skin['market_price']>minPrice && skin['market_price']<maxPrice){return createSkin(skin, 'profit_ratio', 'market_price', 'steam_autobuy', 'market_link', 'steam_link')}}
        )
    }
    else {
      return withdrawData.map((skin) => 
        {if (skin['steam_price']>minPrice && skin['steam_price']<maxPrice){return createSkin(skin, 'withdrawal_profit', 'steam_price', 'market_autobuy', 'steam_link', 'market_link')}}
        )
    }
  }
  
    return (
      <div>
      <ul className="content">
        {sort(sortBy)}
      </ul>
      </div>
    )
  }
 
function App() {
  const [sortBy, setSort] = useState(true)
  const [minPrice, setMin] = useState(0)
  const [maxPrice, setMax] = useState(100000)
  return (
    <>
    <Header setSort={setSort} setMin={setMin} setMax={setMax} />
    <Body sortBy={sortBy} minPrice={minPrice} maxPrice={maxPrice} setMax={setMax} />
    
    </>
  );
}

export default App;